import React from 'react';
import styled from 'styled-components';

const Input = ({type, placeholder}) => {
  return (
    <Container>
        <StyledInput
            placeholder={placeholder & placeholder}
            type={type ? type : "text"}
            required
            autocomplete="off"
        />

    </Container>
  );
};



const StyledInput = styled.input`
height: 54px;
width: 420px;
left: 0px;
top: 27px;
border-radius: 8px;

`;

export default Input
